    // user: is an object that represents a user
    return {
      type: "SET_VIDEOS",
      payload: videos,
    };
  };
  export const WatchLater = (videos) => {
    // user: is an object that represents a user
    return {
      type: "WATCH_LATER",
      payload: videos,
    };
  };
